INSERT INTO `v1_b67292b9f81b8f31febfcc4fed5586f42e4ad392e3514861dfcffa0d26798d3b` VALUES (16612, 10, 0, 1, 11, "ふふ、やった！　やったぞ！\nまたしても傑作の完成だ！\nみんなの努力が実る、この瞬間……\n何度やっても達成感があるな！", 0, 1, 100911, 0.5, 16612026);
