INSERT INTO `v1_b67292b9f81b8f31febfcc4fed5586f42e4ad392e3514861dfcffa0d26798d3b` VALUES (16612, 10, 0, 1, 11, "ちょ、ちょっとアンナさん……\nあなた全身、絵の具だらけで\n動くたびに飛び散ってますわ。\n少し大人しくしてもらえますか？", 0, 1, 102711, 0.5, 16612031);
