INSERT INTO `v1_b67292b9f81b8f31febfcc4fed5586f42e4ad392e3514861dfcffa0d26798d3b` VALUES (16612, 10, 0, 1, 11, "あははっ！　そういうエリコ様も\nおててが絵の具だらけでござるよ～！\nむふふ、いわゆるギャップ萌え\nというやつですな？", 0, 1, 101311, 0.5, 16612036);
