INSERT INTO `v1_b67292b9f81b8f31febfcc4fed5586f42e4ad392e3514861dfcffa0d26798d3b` VALUES (16612, 10, 0, 1, 11, "まったくもう……\nみんなして絵の具まみれじゃない。\nって、あら？　この赤いのは……", 0, 1, 105111, 0.5, 16612041);
