INSERT INTO `v1_b67292b9f81b8f31febfcc4fed5586f42e4ad392e3514861dfcffa0d26798d3b` VALUES (23812, 10, 0, 1, 11, "はぁ、思わずため息が出るよ。\nかわいいボクが、美しい絵を描く。\nただそれだけで、言葉にできないほど\n尊い場面になってしまうよね？", 0, 1, 100811, 0.5, 23812026);
